import{T as a,d as I,b as w,J as T,w as v,c as B,z as K,A as c,B as A,o as d,e,t as s,u as t,C as k,a as h,i as R,n as g,K as D,Q as E,F as _,m as L,h as S,k as C,H as j,q as x,s as H,_ as M}from"./index-7e48c546.js";const z=[{key:"A",arch:a.Cr,name:{id:"Teluk Tumpuk",en:"Raft of Dreams"},description:{id:"Kotak yang penuh dengan gagasan dan ide-ide besar, berdesakan dan berebutan untuk diwujudkan menjadi karya tiada duanya. Kotak ini bekal berhargamu untuk menyalurkan kreativitas tanpa batas.",en:"Ideas, Innovation, Realization"}},{key:"B",arch:a.Ex,name:{id:"Sungai Simpang",en:"Trail of Memories"},description:{id:"Peta perjalanan dan jurnal petualangan yang tersimpan dalam kotak ini tidak sekadar artefak, tapi makna eksplorasi dan hasil penemuan. Masing-masing membuka jalur seribu cabang, menggelitik langkahmu yang panjang.",en:"Exploration, Adventure, Discovery"}},{key:"C",arch:a.Ru,name:{id:"Tebing Kendali",en:"Might of the Great"},description:{id:"Di dalam kotak ini, tersusun rapi segala arsip tentang keputusan besar dan kebijakan, memberi ketenangan saat memastikan bahwa semua dalam kendali setelah melalui persiapan yang matang.",en:"Leadership, Influence, Control"}},{key:"D",arch:a.Sa,name:{id:"Lembah Telaah",en:"Flicker of Wisdom"},description:{id:"Ruang kecil untuk pemikiran yang mendalam, tersimpan filosofi, teori, dan wawasan, membentuk konsep yang mampu memberi pencerahan. Inilah hasil olah pikirmu yang kritis dan reflektif terhadap persoalan kecil maupun besar.",en:"Wisdom, Thought, Enlightenment"}},{key:"E",arch:a.Ca,name:{id:"Hutan Lindung",en:"Haven of the Soul"},description:{id:"Walaupun ruangnya sempit, tapi menyimpan rasa empati yang luas, memampukanmu memberi perhatian dan menolong sesiapa yang membutuhkan. Inilah kotak penuh kehangatan, menyediakan kenyamanan bagi yang terluka.",en:"Care, Compassion, Support"}},{key:"F",arch:a.Ma,name:{id:"Rawa Kabut",en:"Vision's Blueprint"},description:{id:"Jika ada kotak sulap, inilah dia! Tempatmu menyimpan berbagai jenis teropong yang membuatmu bisa melihat dari berbagai cara. Terselip juga kamus dan gagasan untuk diolah menjadi keajaiban. Simsalabim, kejutan!",en:"Transformation, System, Organization"}},{key:"G",arch:a.Ev,name:{id:"Danau Cermin",en:"Fleeting Bond"},description:{id:"Kotak paling sederhana, namun penuh makna. Tempatmu menyimpan konsep kebersamaan dalam bentuk relasi dan interaksi di keseharian. Menjadi bekalmu untuk membaur dengan sekitar.",en:"Relationship, Simplicity, Experience"}},{key:"H",arch:a.Re,name:{id:"Rimba Liar",en:"Defying Obstacles"},description:{id:"Aha, kotak paling tajam--tapi kenapa tidak? Inilah kotak untuk menyimpan aksi dan keberanian, setiap lembar mendorongmu untuk bergerak menantang status quo. Tidak ada halangan bagimu untuk melawan arus. Kalau harus lawan, LAWAN!",en:"Rebellion, Defiance, Change"}},{key:"I",arch:a.En,name:{id:"Kolam Susu",en:"Weaving Tales"},description:{id:"Sejuta candaan, cerita, dan citra, tersimpan dalam kotak kecil ini, menjadi kotak andalanmu untuk menghibur dan meramaikan suasana. Setiap kali dibuka, lembarannya mengundang gelak tawa, mencipta senang dengan berbagai cara.",en:"Entertainment, Storytelling, Inspiration"}},{key:"J",arch:a.In,name:{id:"Bukit Matahari",en:"Sowing the Light"},description:{id:"Ini adalah kotak paling murni, penuh dengan kebaikan, baik dalam bentuk niat maupun tujuan. Kotak ini memberi inspirasi dan pencerahan untuk tetap positif dan optimis, menjaga semangat dalam setiap langkah yang diambil.",en:"Goodness, Innocence, Hope"}},{key:"K",arch:a.Lo,name:{id:"Telaga Rasa",en:"Echo of Passion"},description:{id:"Dibanding yang lain, ini adalah kotak termanis. Berisi kenangan dan perasaan yang terlibat di dalamnya. Tidak hanya tentangmu, tapi juga tentang orang terdekatmu. Menjadi glosarium mini untuk bekalmu membangun hubungan yang kuat.",en:"Love, Connection, Intimacy"}},{key:"L",arch:a.He,name:{id:"Kaki Gunung Raya",en:"Tread of the Storm"},description:{id:"Kotak ini menyimpan motivasi yang gigih dan kekuatan untuk bergerak dan berdampak. Setiap fragmennya adalah api semangat agar tidak tinggal diam saat melihat ketimpangan. Inilah kotak ketangguhan, rela berkorban demi keadilan.",en:"Courage, Struggle, Heroism"}}],F=o=>(x("data-v-b5281379"),o=o(),H(),o),N=F(()=>e("div",null,null,-1)),P=["onClick"],V={class:"letter"},W={class:"sub-title-frame"},$={class:"question"},G={class:"row"},q=I({__name:"SelfAnswersPage",setup(o){const b=w(),y=T(),n=v(null),r=v(null);function p(u){var i;u?((i=n.value)==null?void 0:i.arch)==u.arch?n.value=null:n.value=r.value=u:n.value=null}return B(()=>b.resultData.topArchetypes.self),(u,i)=>(d(),K(A,{"inner-class":{"self-answers":!0}},{default:c(()=>[N,e("p",null,s(t(k)("1")),1),e("div",{class:g(["answers",{filled:!!n.value}])},[(d(!0),h(_,null,R(t(z),(l,m)=>{var f;return d(),h("div",{key:m,class:g(["answer basic-frame",{highlighted:((f=n.value)==null?void 0:f.arch)==l.arch}]),style:D({borderImageSource:t(E)("basic-frame-2")}),onClick:J=>p(l)},[e("div",V,s(l.key),1)],14,P)}),128))],2),e("div",{class:g(["filter",{active:!!n.value}]),onClick:i[0]||(i[0]=l=>p())},null,2),e("div",{class:g(["drawer",{active:!!n.value}])},[r.value?(d(),h(_,{key:0},[e("div",W,[e("h2",null,s(r.value.key+". "+r.value.name[t(y).lang]),1)]),e("p",null,s(r.value.description[t(y).lang]),1)],64)):L("",!0),e("p",$,s(t(k)("2")),1),e("div",G,[S(j,{class:"no","bg-color":"black",color:"white",small:"","no-nav":"",onClick:i[1]||(i[1]=l=>p())},{default:c(()=>[C(s(t(k)("no")),1)]),_:1}),S(j,{class:"yes","bg-color":"black",color:"white",small:"",onClick:i[2]||(i[2]=l=>{var m;return t(b).selectSelf((m=n.value)==null?void 0:m.arch)})},{default:c(()=>[C(s(t(k)("yes")),1)]),_:1})])],2)]),_:1}))}});const Q=M(q,[["__scopeId","data-v-b5281379"]]);export{Q as default};
